import React from "react";

export const generateOptions = (optionList, category, module) => {
    console.log(category);
    console.log(module);
    if(category === "grade") {
        return optionList.map((option) => {
            return (
                <option value={option.grade} module={module}>
                {option.grade}
                </option>
            );
        })
    }

    return optionList.map((option) => {
        return (
            <option value={option}>
            {option}
            </option>
        );
    });
}
